import React, { useEffect, useState }from 'react';
import './App.css';

function App() {
const [album, setAlbum] = useState('');
useEffect(()=>{
  axios.get("http://localhost:3333/albums")
  .then(album => setAlbum (album.name));

}, [])
  return (
    <>
    <p>album:{album.name}</p>
    </>
  );
}

export default App;
